import React from 'react';

import { Container } from './styles';


export default function SocialMidia() {

  return (
    <Container>
      <nav>
        <ul>
          <li><a href="https://www.linkedin.com/in/dan-sim%C3%B5es/"><i class="fa fa-facebook" aria-hidden="true"></i></a></li>
          <li><a href="https://www.linkedin.com/in/dan-sim%C3%B5es/"><i class="fa fa-twitter" aria-hidden="true"></i></a></li>
          <li><a href="https://www.linkedin.com/in/dan-sim%C3%B5es/"><i class="fa fa-linkedin" aria-hidden="true"></i></a></li>
        </ul>
      </nav>
    </Container>
  );
}
